export default {
    video_background_color:'rgba(238, 53, 53, 0.4)',
    audio_background_color:'rgba(238, 195, 53, 0.4)',
    video_audio_background_color:'rgba(186, 53, 238, 0.4)',
    text_background_color:'rgba(53, 127, 238, 0.4)',
    legend:[{
        color:'rgba(51, 153, 255,0.5)',
        bg:'rgba(51, 153, 255,0.5)',
        tip:"Video Modified"
    },{
        color:'rgb(235, 232, 64,0.5)',
        bg:'rgba(235, 232, 64,0.5)',
        tip:"Audio Modified"
    },{
        color:'rgb(255, 51, 0,0.6)',
        bg:'rgba(255, 51, 0,0.5)',
        tip:"Text Modified"
    },{
        color:'rgb(102, 204, 51,0.6)',
        bg:'rgba(102, 204, 51,0.5)',
        tip:"Video & Audio Modified"
    },{
        color:'rgb(102, 51, 255,0.5)',
        bg:'rgba(102, 51, 255,0.5)',
        tip:"Video & Text Modified"
    },{
        color:'rgb(255, 153, 0,0.5)',
        bg:'rgba(255, 153, 0,0.5)',
        tip:"Audio & Text Modified"
    },{
        color:'rgb(51, 51, 51,0.5)',
        bg:'rgba(51, 51, 51,0.5)',
        tip:"Video & Audio & Text Modified"
    }]
}
